message:
..."acabará sendo" ?
🤔
Este texto é anterior ao dia 12.12.22 , acho.

Os piores locais são onde tem maior atuação/proximidade dos narcos. 
São cidades (não Estados):     
- Rio;
- São Paulo;
- Recife;
- Fortaleza;
- Salvador;
- São Luís;
- Belém;
- Belo Horizonte; 
- Porto Alegre.

As operações das Forças Auxiliares nestes locais (nas últimas semanas)  tiveram o objetivo de apreensão de armamentos.    

Sobre o preparo, além de mantimentos e remédios,    
Guardem seus veículos, carros, motos, trailers em locais seguros.

Pode haver instabilidade de energia, ter enlatados, velas etc.

Estimar data x ou y é uma estimativa, não uma certeza.
